import React from 'react'
import VideoCard from './VideoCard'

const Videos = ({videos}) => {
  console.log(videos);
  return (
    <div direction='row' style={{flexWrap:'wrap', justifyContent:'start'}} gap={2}>
      {videos.map((item, idx) => (
        <div key={idx}>
          {item.id.videoId && <VideoCard video={item} /> }
        </div>
      ))}
    </div>
  )
}

export default Videos
